import React from "react";
import { BrowserRouter } from "react-router-dom";
import { createBrowserHistory } from "history";
import App from "../shared/App";

const history = createBrowserHistory();

const Root = () => (
  <BrowserRouter history={history}>
    <App></App>
  </BrowserRouter>
);

export default Root;
